import React, { Component } from "react";

class Home extends Component {

  render() {
    return (
      <div>
        <h2>HELLO</h2>
        <p>This is the homepage of our app</p>

        <img src={require('full-body-scan.jpg')} />

        <p></p>
      </div>
    );
  }
}

export default Home;
